import { Plus } from "lucide-react";

const VideoCard = ({
  title,
  author,
  duration,
}: {
  title: string;
  author: string;
  duration: string;
}) => (
  <div className="bg-white rounded-lg shadow-md overflow-hidden">
    <div className="w-full h-48 bg-black"></div>
    <div className="p-4">
      <h3 className="text-lg font-medium mb-2">{title}</h3>
      <p className="text-gray-500 text-sm">{author}</p>
    </div>
  </div>
);

const Dashboard = () => {
  const Cards = [
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고호 시토후, 이순신",
      duration: "30분반",
    },
  ];

  return (
    <div className="min-h-screen bg-green-50 p-8">
      {/* Header */}
      <div className="mb-8">
        <h1 className="text-2xl font-bold mb-4">대시보드</h1>
        <h2 className="text-lg mb-4">내 채팅 기록</h2>
      </div>

      {/* Video Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {Cards.map((video, index) => (
          <VideoCard
            key={index}
            title={video.title}
            author={video.author}
            duration={video.duration}
          />
        ))}
      </div>

      {/* Add New Button */}
      <button className="fixed bottom-8 right-8 bg-green-700 text-white rounded-full p-4 shadow-lg hover:bg-green-800 transition-colors">
        <Plus className="w-6 h-6" />
        <span className="ml-2">새 채팅 시작하기</span>
      </button>
    </div>
  );
};

export default Dashboard;
